@override
  void didChangeDependencies() {
  super.didChangeDependencies();

  if (widget.fuel) {
    Future.microtask(() {
      fuelState(true);
    });
  } else if (widget.systemReady) {
    Future.microtask(() {
      fuelState(true);
      systemReadyState(true);
    });
  }
   else if(widget.cold){
      Future.microtask(() {
fuelState(true);
      systemReadyState(true);
      coldState(true);
      });
    }
    else if(widget.hot){
      Future.microtask(() {
      fuelState(true);
      systemReadyState(true);
      coldState(true);
      hotState(true);
      });
}

}


