  void _updateTween() {
    tween = MovieTween()
      ..scene(
              begin: const Duration(seconds: 0),
              end: const Duration(seconds: 3))
          .tween(
              'needle',
              Tween<double>(
                  begin: (17.6667 * val1) - 135, end: (17.6667 * val) - 135))
      ..scene(
              begin: const Duration(seconds: 0),
              end: const Duration(seconds: 3))
          .tween('flow', Tween<double>(begin: 0, end: 100))
      ..scene(
              begin: const Duration(seconds: 0),
              end: const Duration(seconds: 3))
          .tween('light', Tween<double>(begin: 0.35, end: 1.0))
      ..scene(
              begin: const Duration(seconds: 0),
              end: const Duration(seconds: 3))
          .tween('flow1', Tween<double>(begin: 500.01, end: 0.01));
  }

  void _showNextText() async {
    while (!stopFunction) {
      for (int i = start;
          (ref
                          .read(mapListProvider)[prechecks]["steps"]
                              [startModule]["steps"]
                          .length -
                      start <=
                  4
              ? i <=
                  ref
                      .read(mapListProvider)[prechecks]["steps"][startModule]
                          ["steps"]
                      .length
              : i < start + 5);
          i++) {
        stepId = stepId + 1;
        print("stepId.........................$stepId");
        if (stopFunction) {
          break; // Exit the loop if stopFunction is true
        }

        if (isPaused) {
          await _waitForFlagToChange();
        }

        await Future.delayed(const Duration(seconds: 2), () async {
          if (isPaused) {
            await _waitForFlagToChange();
          }
        });

        if (currentIndex == 5) {
          if (isPaused) {
            await _waitForFlagToChange();
          }
          print("if part...............................");

          setState(() {
            _visibilityList = [false, false, false, false, false];
          });

          await Future.delayed(const Duration(seconds: 2), () async {
            if (isPaused) {
              await _waitForFlagToChange();
            }
          });

          if (isPaused) {
            await _waitForFlagToChange();
          }
          setState(() {
            start += 5;
            currentIndex = 0;
            print("Start $start");
            print("currentIndex $currentIndex");
          });

          break;
        } else if (i ==
            ref
                .read(mapListProvider)[prechecks]["steps"][startModule]["steps"]
                .length) {
          if (isPaused) {
            await _waitForFlagToChange();
          }

          print("last part..........................");
          setState(() {
            titleVisibility = false;
            _visibilityList = [false, false, false, false, false];
            print("titleVisibility $titleVisibility");
          });

          await Future.delayed(
            const Duration(seconds: 2),
            () async {
              if (isPaused) {
                await _waitForFlagToChange();
              }
            },
          );
          if (isPaused) {
            await _waitForFlagToChange();
          }
    

          if (ref.read(mapListProvider)[prechecks]["steps"][startModule]
                  ["id"] !=
              ref.read(mapListProvider)[prechecks]["steps"].length) {
            print('''ref.read(mapListProvider)[prechecks]["steps"][startModule]
                  ["id"] ${ref.read(mapListProvider)[prechecks]["steps"][startModule]["id"]}''');

            setState(() {
              moduleLength++;
              start = 0;
              currentIndex = 0;
              startModule++;
              titleVisibility = true;
              print("start $start");
              print("currentIndex $currentIndex");
            });
          } else {
            print("Break part.........");

            print('''ref.read(mapListProvider)[prechecks]["steps"][startModule]
                  ["id"] ${ref.read(mapListProvider)[prechecks]["steps"][startModule]["id"]}''');
            stopFunction = true;

            if (widget.fuel) {
    Future.microtask(() {
      fuelState(false);
    });
  } else if (widget.systemReady) {
    Future.microtask(() {
      fuelState(false);
      systemReadyState(false);
    });
  }
   else if(widget.cold){
      Future.microtask(() {
fuelState(false);
      systemReadyState(false);
      coldState(false);
      });
    }
    else if(widget.hot){
      Future.microtask(() {
      fuelState(false);
      systemReadyState(false);
      coldState(false);
      hotState(false);
      });
}
            Navigator.push(
                context, MaterialPageRoute(builder: (context) => const Home()));

            break;
          }
        } else {
          print("i..................................$i");
          if (i == 0) {
            if (isPaused) {
              await _waitForFlagToChange();
            }
            print("first part.....................");
            setState(() {
              titleVisibility = true;
              print(titleVisibility);
            });

            if (isPaused) {
              await _waitForFlagToChange();
            }
            await Future.delayed(const Duration(seconds: 1), () async {
              if (isPaused) {
                await _waitForFlagToChange();
              }
            });
          }

          if (isPaused) {
            await _waitForFlagToChange();
          }

          print("else part...............................");

          if (isPaused) {
            await _waitForFlagToChange();
          }
          setState(() {
            _visibilityList[currentIndex] = true;
            print(_visibilityList);
          });

          if (isPaused) {
            await _waitForFlagToChange();
          }

          ref
              .read(mapListProvider.notifier)
              .updateStepState(prechecks, startModule, i, true);
          print(
              "$startModule....$i.....${ref.read(mapListProvider)[prechecks]["steps"][startModule]["steps"][i]["state"]}");

          await player.play(AssetSource(ref.read(mapListProvider)[prechecks]
              ["steps"][startModule]["steps"][i]["Voice"]));
          _playerState = player.state;

          while (_playerState == PlayerState.playing) {
            await Future.delayed(const Duration(milliseconds: 100));
            _playerState = player.state;
          }

          await Future.delayed(const Duration(seconds: 1), () async {
            if (isPaused) {
              await _waitForFlagToChange();
            }
          });
          if (isPaused) {
            await _waitForFlagToChange();
          }

          await Future.delayed(const Duration(seconds: 3), () async {
            if (isPaused) {
              await _waitForFlagToChange();
            }
          }).then((value) async {
            if (_playerState == PlayerState.paused) {
              print("Paused State........................");
              print("Will skip to next iteration..............");
              setState(() {
                currentIndex++;
                print(currentIndex);
              });
            } else {
              print("Next................");
              setState(() {
                currentIndex++;
                print(currentIndex);
              });
            }
          });
          if (isPaused) {
            await _waitForFlagToChange();
          }
        }
      }
    }
  }


